/**
 * Agent Orchestrator
 * Coordinates AI agent task execution and conversation management
 */

import { createAdminClient } from '@/app/lib/supabase/admin';
import { OpenAIProvider } from './providers/openai-provider';
import { AnthropicProvider } from './providers/anthropic-provider';
import { ToolRegistry } from './tools/registry';
import { calculateCost, logAIUsage, type CostCalculation } from './cost-tracker';
import { checkGlobalRateLimit, checkOrgRateLimit, checkAgentRateLimit } from './rate-limiter';

export interface AgentTask {
  id: string;
  agent_id: string;
  organization_id: string;
  title: string;
  description: string | null;
  task_type: 'adhoc' | 'scheduled' | 'automation';
  context: Record<string, any>;
  status: 'pending' | 'queued' | 'running' | 'completed' | 'failed' | 'cancelled';
  priority: number;
  retry_count: number;
  max_retries: number;
  error_message: string | null;
  result: Record<string, any> | null;
  tokens_used: number;
  cost_usd: number;
  execution_time_ms: number | null;
  created_at: string;
  updated_at: string;
}

export interface Agent {
  id: string;
  organization_id: string;
  role: string;
  name: string;
  description: string;
  system_prompt: string;
  model: string;
  temperature: number;
  max_tokens: number;
  allowed_tools: string[];
  metadata: Record<string, any>;
}

export interface TaskExecutionResult {
  success: boolean;
  result?: Record<string, any>;
  error?: string;
  tokensUsed: number;
  costUsd: number;
  executionTimeMs: number;
}

export interface ExecuteMessageOptions {
  conversationId: string;
  userMessage: string;
  organizationId: string;
  userId: string;
}

export interface ExecuteMessageResult {
  success: boolean;
  userMessage?: {
    id: string;
    role: "user";
    content: string;
    created_at: string;
  };
  assistantMessage?: {
    id: string;
    role: "assistant";
    content: string;
    tool_calls?: any;
    tokens_used: number;
    cost_usd: number;
    created_at: string;
  };
  cost: CostCalculation;
  error?: string;
}

