   283/**
   284 * Generate LTV Report
   285 * Calculates customer lifetime value metrics
   286 */
   287export class GenerateLTVReportTool extends BaseTool {
   288  id = 'generate_ltv_report';
   289  name = 'Generate LTV Report';
   290  description = 'Calculate customer lifetime value (LTV) with breakdown by cohort, plan, and acquisition source';
   291  category: 'analytics' = 'analytics';
   292
   293  parametersSchema = z.object({
   294    cohortBy: z.enum(['month', 'quarter', 'year']).default('month').describe('Group customers into cohorts'),
   295    includeProjection: z.boolean().default(true).describe('Include LTV projection'),
   296  });
   297
   298  requiresPermission = 'reports:read';
   299
   300  async execute(
   301    params: z.infer<typeof this.parametersSchema>,
   302    context: ToolExecutionContext
   303  ): Promise<ToolExecutionResult> {
   304    const startTime = Date.now();
   305
   306    try {
   307      const supabase = createAdminClient();
   308
   309      // Get all customers with their payments
   310      const { data: customers, error } = await supabase
   311        .from('clients')
   312        .select(`
   313          id,
   314          created_at,
   315          source,
   316          payments(amount, payment_date, payment_status)
   317        `)
   318        .eq('organization_id', context.organizationId);
   319
   320      if (error) throw error;
   321
   322      // Calculate LTV per customer
   323      const customerLTVs = customers?.map(customer => {
   324        const payments = (customer.payments as any[]) || [];
   325        const totalSpent = payments
   326          .filter(p => ['paid_out', 'succeeded', 'confirmed'].includes(p.payment_status))
   327          .reduce((sum, p) => sum + (parseFloat(p.amount) || 0), 0);
   328
   329        const firstPayment = payments
   330          .filter(p => p.payment_date)
   331          .sort((a, b) => new Date(a.payment_date).getTime() - new Date(b.payment_date).getTime())[0];
   332
   333        const lastPayment = payments
   334          .filter(p => p.payment_date)
   335          .sort((a, b) => new Date(b.payment_date).getTime() - new Date(a.payment_date).getTime())[0];
   336
   337        const lifespanDays = firstPayment && lastPayment
   338          ? Math.max(1, (new Date(lastPayment.payment_date).getTime() - new Date(firstPayment.payment_date).getTime()) / (1000 * 60 * 60 * 24))
   339          : 0;
   340
   341        // Determine cohort
   342        const cohortDate = new Date(customer.created_at);
   343        let cohort: string;
   344        switch (params.cohortBy) {
   345          case 'quarter':
   346            cohort = `${cohortDate.getFullYear()}-Q${Math.floor(cohortDate.getMonth() / 3) + 1}`;
   347            break;
   348          case 'year':
   349            cohort = `${cohortDate.getFullYear()}`;
   350            break;
   351          default:
   352            cohort = cohortDate.toISOString().substring(0, 7);
   353        }
   354
   355        return {
   356          customerId: customer.id,
   357          cohort,
   358          source: customer.source,
   359          totalSpent,
   360          paymentCount: payments.length,
   361          lifespanDays,
   362          avgMonthlyValue: lifespanDays > 0 ? (totalSpent / lifespanDays) * 30 : 0,
   363        };
   364      }) || [];
   365
   366      // Group by cohort
   367      const cohorts = new Map<string, {
   368        customers: number;
   369        totalLTV: number;
   370        avgLTV: number;
   371        avgLifespan: number;
   372      }>();
   373
   374      customerLTVs.forEach(c => {
   375        if (!cohorts.has(c.cohort)) {
   376          cohorts.set(c.cohort, { customers: 0, totalLTV: 0, avgLTV: 0, avgLifespan: 0 });
   377        }
   378        const cohort = cohorts.get(c.cohort)!;
   379        cohort.customers++;
   380        cohort.totalLTV += c.totalSpent;
   381        cohort.avgLifespan += c.lifespanDays;
   382      });
   383
   384      cohorts.forEach(cohort => {
   385        cohort.avgLTV = cohort.customers > 0 ? cohort.totalLTV / cohort.customers : 0;
   386        cohort.avgLifespan = cohort.customers > 0 ? cohort.avgLifespan / cohort.customers : 0;
   387      });
   388
   389      // Group by source
   390      const sources = new Map<string, { customers: number; avgLTV: number }>();
   391      customerLTVs.forEach(c => {
   392        const source = c.source || 'Unknown';
   393        if (!sources.has(source)) {
   394          sources.set(source, { customers: 0, avgLTV: 0 });
   395        }
   396        const sourceData = sources.get(source)!;
   397        sourceData.avgLTV = (sourceData.avgLTV * sourceData.customers + c.totalSpent) / (sourceData.customers + 1);
   398        sourceData.customers++;
   399      });
   400
   401      const totalLTV = customerLTVs.reduce((sum, c) => sum + c.totalSpent, 0);
   402      const avgLTV = customerLTVs.length > 0 ? totalLTV / customerLTVs.length : 0;
   403      const medianLTV = customerLTVs.length > 0
   404        ? customerLTVs.sort((a, b) => a.totalSpent - b.totalSpent)[Math.floor(customerLTVs.length / 2)].totalSpent
   405        : 0;
   406
   407      return {
   408        success: true,
   409        data: {
   410          summary: {
   411            totalCustomers: customerLTVs.length,
   412            avgLTV,
   413            medianLTV,
   414            totalLTV,
   415          },
   416          cohorts: Array.from(cohorts.entries()).map(([cohort, data]) => ({
   417            cohort,
   418            ...data,
   419          })),
   420          sources: Array.from(sources.entries()).map(([source, data]) => ({
   421            source,
   422            ...data,
   423          })),
   424          topCustomers: customerLTVs
   425            .sort((a, b) => b.totalSpent - a.totalSpent)
   426            .slice(0, 10)
   427            .map(c => ({
   428              customerId: c.customerId,
   429              ltv: c.totalSpent,
   430              avgMonthlyValue: c.avgMonthlyValue,
   431            })),
   432        },
   433        metadata: {
   434          recordsAffected: customers?.length || 0,
   435          executionTimeMs: Date.now() - startTime,
   436        },
   437      };
   438    } catch (error) {
   439      return {
   440        success: false,
   441        error: error instanceof Error ? error.message : 'Failed to generate LTV report',
   442      };
   443    }
   444  }
   445}
