   671    const startTime = Date.now();
   672
   673    try {
   674      const supabase = createAdminClient();
   675      const asOfDate = params.asOfDate || new Date().toISOString().split('T')[0];
   676
   677      // Get active memberships
   678      const { data: memberships, error } = await supabase
   679        .from('customer_memberships')
   680        .select(`
   681          id,
   682          monthly_price,
   683          status,
   684          start_date,
   685          membership_plans(name, category)
   686        `)
   687        .eq('organization_id', context.organizationId)
   688        .eq('status', 'active')
   689        .lte('start_date', asOfDate)
   690        .or(`end_date.is.null,end_date.gt.${asOfDate}`);
   691
   692      if (error) throw error;
   693
   694      // Calculate ARR (MRR * 12)
   695      const mrr = memberships?.reduce((sum, m) => sum + parseFloat((m.monthly_price as any) || '0'), 0) || 0;
   696      const arr = mrr * 12;
   697
   698      // Calculate growth (compare to last year)
   699      const lastYearDate = new Date(asOfDate);
   700      lastYearDate.setFullYear(lastYearDate.getFullYear() - 1);
   701      const lastYearDateString = lastYearDate.toISOString().split('T')[0];
   702
   703      const { data: lastYearMemberships } = await supabase
   704        .from('customer_memberships')
   705        .select('monthly_price')
   706        .eq('organization_id', context.organizationId)
   707        .eq('status', 'active')
   708        .lte('start_date', lastYearDateString)
   709        .or(`end_date.is.null,end_date.gt.${lastYearDateString}`);
   710
   711      const lastYearMRR = lastYearMemberships?.reduce((sum, m) => sum + parseFloat((m.monthly_price as any) || '0'), 0) || 0;
   712      const lastYearARR = lastYearMRR * 12;
   713      const growth = lastYearARR > 0 ? ((arr - lastYearARR) / lastYearARR) * 100 : 0;
   714
   715      return {
   716        success: true,
   717        data: {
   718          arr,
   719          mrr,
   720          activeMemberships: memberships?.length || 0,
   721          asOfDate,
   722          yearOverYear: {
   723            currentARR: arr,
   724            previousARR: lastYearARR,
   725            growth,
   726            growthAmount: arr - lastYearARR,
   727          },
   728        },
   729        metadata: {
   730          recordsAffected: memberships?.length || 0,
   731          executionTimeMs: Date.now() - startTime,
   732        },
   733      };
   734    } catch (error) {
   735      return {
   736        success: false,
   737        error: error instanceof Error ? error.message : 'Failed to calculate ARR',
   738      };
   739    }
   740  }
